    t.add("bitrix_integration_capabilities_heading", "\u0423\u0432\u0435\u043b\u0438\u0447\u044c\u0442\u0435 \u044d\u0444\u0444\u0435\u043a\u0442\u0438\u0432\u043d\u043e\u0441\u0442\u044c \u0442\u0435\u043b\u0435\u0444\u043e\u043d\u043d\u044b\u0445 \u043f\u0440\u043e\u0434\u0430\u0436, \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044f HyperScript \u0434\u043b\u044f \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0437\u0430\u0446\u0438\u0438 \u0441\u043a\u0440\u0438\u043f\u0442\u043e\u0432\n                    \u0440\u0430\u0437\u0433\u043e\u0432\u043e\u0440\u0430!", "messages", "ru");
