    t.add("bitrix_integrate_instructions_1", "\u041d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e \u0432\u043e\u0439\u0442\u0438 \u0432 \u0411\u0438\u0442\u0440\u0438\u043a\u044124 \u043f\u043e\u0434 \u0443\u0447\u0435\u0442\u043d\u043e\u0439 \u0437\u0430\u043f\u0438\u0441\u044c\u044e \u0441 \u043f\u0440\u0430\u0432\u0430\u043c\u0438 \u0430\u0434\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430\u0442\u043e\u0440\u0430, \u043f\u0435\u0440\u0435\u0439\u0442\u0438 \u0432 \u0440\u0430\u0437\u0434\u0435\u043b\n                    \u00ab\u041f\u0440\u0438\u043b\u043e\u0436\u0435\u043d\u0438\u044f\u00bb \u2013 \u00ab\u0412\u0441\u0435 \u043f\u0440\u0438\u043b\u043e\u0436\u0435\u043d\u0438\u044f\u00bb \u0432 \u043e\u0441\u043d\u043e\u0432\u043d\u043e\u043c \u043c\u0435\u043d\u044e.", "messages", "ru");
    t.add("bitrix_integrate_instructions_2", "\u0417\u0430\u0442\u0435\u043c \u0432\u0441\u0435 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u044b, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0431\u0443\u0434\u0443\u0442 \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u0441\u043a\u0440\u0438\u043f\u0442\u0430\u043c\u0438, \u0434\u043e\u043b\u0436\u043d\u044b \u0441\u0434\u0435\u043b\u0430\u0442\u044c \u0430\u043a\u043a\u0430\u0443\u043d\u0442 \u043d\u0430\n                    <a href=\"http:\/\/hyper-script.ru\">http:\/\/hyper-script.ru<\/a>, \u043f\u0440\u043e\u0439\u0434\u044f \u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u044e.", "messages", "ru");
    t.add("bitrix_integrate_instructions_3", "\u041f\u043e\u0441\u043b\u0435 \u044d\u0442\u043e\u0433\u043e \u043a\u0430\u0436\u0434\u044b\u0439 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0434\u043e\u043b\u0436\u0435\u043d \u0432\u043e\u0439\u0442\u0438 \u0432 \u0411\u0438\u0442\u0440\u0438\u043a\u044124, \u043f\u0435\u0440\u0435\u0439\u0442\u0438 \u043d\u0430 \u0432\u043a\u043b\u0430\u0434\u043a\u0443 \u00ab\u0421\u043a\u0440\u0438\u043f\u0442\u044b\u00bb \u0432 \u043e\u0441\u043d\u043e\u0432\u043d\u043e\u043c\n                    \u043c\u0435\u043d\u044e, \u0441\u043b\u0435\u0432\u0430. \u0412 \u043e\u0441\u043d\u043e\u0432\u043d\u043e\u0439 \u043e\u0431\u043b\u0430\u0441\u0442\u0438 \u0431\u0443\u0434\u0435\u0442 \u0432\u0438\u0434\u043d\u0430 \u0444\u043e\u0440\u043c\u0430 \u0430\u0432\u0442\u043e\u0440\u0438\u0437\u0430\u0446\u0438\u0438. \u0412 \u044d\u0442\u0443 \u0444\u043e\u0440\u043c\u0443 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0432\u0432\u043e\u0434\u0438\u0442\n                    \u0421\u0412\u041e\u0418 \u043b\u043e\u0433\u0438\u043d-\u043f\u0430\u0440\u043e\u043b\u044c \u043e\u0442 \u0430\u043a\u043a\u0430\u0443\u043d\u0442\u0430 \u00abHyperScript\u00bb, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u0440\u0430\u043d\u0435\u0435 \u0432 \u0445\u043e\u0434\u0435 \u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u0438 \u043d\u0430\n                    <a href=\"http:\/\/hyper-script.ru\">http:\/\/hyper-script.ru<\/a>.", "messages", "ru");
    t.add("bitrix_integrate_instructions_4", "\u0410\u043a\u043a\u0430\u0443\u043d\u0442 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430 \u043f\u0440\u0438\u0432\u044f\u0437\u0430\u043d. \u0412\u0430\u043c \u0442\u0430\u043a\u0436\u0435 \u043f\u043e\u0442\u0440\u0435\u0431\u0443\u0435\u0442\u0441\u044f \u0432\u044b\u0434\u0430\u0442\u044c \u0434\u043e\u0441\u0442\u0443\u043f \u043a \u0441\u043a\u0440\u0438\u043f\u0442\u0430\u043c, \u0447\u0442\u043e\u0431\u044b \u043e\u043d\u0438 \u0441\u0442\u0430\u043b\u0438\n                    \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u044b \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430\u043c. \u042d\u0442\u043e \u0434\u0435\u043b\u0430\u0435\u0442\u0441\u044f \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u043c. \u0412\u044b \u0441\u043e\u0437\u0434\u0430\u0435\u0442\u0435 \u0441\u043a\u0440\u0438\u043f\u0442 \u0432 HyperScript,\n                    \u043f\u0435\u0440\u0435\u0445\u043e\u0434\u0438\u0442\u0435 \u043d\u0430 \u0432\u043a\u043b\u0430\u0434\u043a\u0443 \u00ab\u0414\u043e\u0441\u0442\u0443\u043f\u00bb, \u0432\u043f\u0438\u0441\u044b\u0432\u0430\u0435\u0442\u0435 \u0432 \u0444\u043e\u0440\u043c\u0443 e-mail \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430, \u043f\u043e\u0434 \u043a\u043e\u0442\u043e\u0440\u044b\u043c \u043e\u043d\n                    \u0437\u0430\u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u043d \u0432 HyperScript (\u0412\u043d\u0438\u043c\u0430\u043d\u0438\u0435! \u042d\u0442\u043e\u0442 e-mail \u043c\u043e\u0436\u0435\u0442 \u043d\u0435 \u0441\u043e\u0432\u043f\u0430\u0434\u0430\u0442\u044c \u0441 e-mail, \u043f\u043e\u0434 \u043a\u043e\u0442\u043e\u0440\u044b\u043c\n                    \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0437\u0430\u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u043d \u0432 \u0411\u0438\u0442\u0440\u0438\u043a\u044124), \u044d\u0442\u043e\u0442 e-mail \u0432\u0441\u0435\u0433\u0434\u0430 \u0432\u0438\u0434\u0435\u043d \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0443 \u0432 \u0432\u0435\u0440\u0445\u043d\u0435\u0439 \u0447\u0430\u0441\u0442\u0438 \u0435\u0433\u043e\n                    \u043b\u0438\u0447\u043d\u043e\u0433\u043e \u043a\u0430\u0431\u0438\u043d\u0435\u0442\u0430 HyperScript.", "messages", "ru");
    t.add("bitrix_share_scripts_with_coworkers_instructions", "\u0427\u0442\u043e\u0431\u044b \u043f\u0440\u0435\u0434\u043e\u0441\u0442\u0430\u0432\u0438\u0442\u044c \u0434\u043e\u0441\u0442\u0443\u043f \u043a \u0441\u043a\u0440\u0438\u043f\u0442\u0443 \u043a\u043e\u043b\u043b\u0435\u0433\u0430\u043c, \u0432\u0432\u0435\u0434\u0438\u0442\u0435 \u0432\u043e \u0432\u043a\u043b\u0430\u0434\u043a\u0435 \"\u0414\u043e\u0441\u0442\u0443\u043f\" \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0443\u044e\u0449\u0435\u0433\u043e \u0441\u043a\u0440\u0438\u043f\u0442\u0430 \u0438\u0445 \u0430\u0434\u0440\u0435\u0441\u0430\n                    \u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u043d\u043e\u0439 \u043f\u043e\u0447\u0442\u044b, \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u043c\u044b\u0435 \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u043b\u043e\u0433\u0438\u043d\u043e\u0432 \u0432 HyperScript \u0434\u043b\u044f \u0441\u0432\u044f\u0437\u0430\u043d\u043d\u044b\u0445 \u0441 \u0411\u0438\u0442\u0440\u0438\u043a\u044124 \u0430\u043a\u043a\u0430\u0443\u043d\u0442\u043e\u0432.", "messages", "ru");
