    t.add("help_statistic_conversion_heading", "\u0421\u0442\u0430\u0442\u0438\u0441\u0442\u0438\u043a\u0430, \u0438\u0437\u043c\u0435\u0440\u0435\u043d\u0438\u0435 \u043a\u043e\u043d\u0432\u0435\u0440\u0441\u0438\u0438", "messages", "ru");
    t.add("help_statistic_conversion_1", "\u0418\u0437\u043c\u0435\u0440\u0435\u043d\u0438\u0435 \u043a\u043e\u043d\u0432\u0435\u0440\u0441\u0438\u0438 \u0441\u043a\u0440\u0438\u043f\u0442\u0430 \u0438 \u043e\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u043e\u0432 \u043e\u0441\u043d\u043e\u0432\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u043d\u0430 \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043a\u0435 \u0446\u0435\u043b\u0435\u0439, \u0434\u043e\u0441\u0442\u0438\u0436\u0435\u043d\u0438\u0435 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0438\n                    \u0431\u0443\u0434\u0435\u0442 \u043f\u043e\u043a\u0430\u0437\u0430\u0442\u0435\u043b\u0435\u043c \u0443\u0441\u043f\u0435\u0448\u043d\u043e\u0433\u043e \u0438\u043b\u0438 \u043d\u0435 \u0443\u0441\u043f\u0435\u0448\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u0445\u043e\u0436\u0434\u0435\u043d\u0438\u044f.", "messages", "ru");
    t.add("help_statistic_conversion_2", "\u0414\u043b\u044f \u0442\u043e\u0433\u043e, \u0447\u0442\u043e\u0431\u044b \u043f\u043e\u0441\u0442\u0430\u0432\u0438\u0442\u044c \u0446\u0435\u043b\u044c, \u043d\u0430\u0445\u043e\u0434\u044f\u0441\u044c \u0432 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0442\u043e\u0440\u0435, \u0432\u044b\u0434\u0435\u043b\u0438\u0442\u0435 \u0443\u0437\u0435\u043b \u0438 \u0432 \u0435\u0433\u043e \u0441\u0432\u043e\u0439\u0441\u0442\u0432\u0430\u0445\n                    \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0435 \u0444\u043b\u0430\u0433 \"\u042f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0446\u0435\u043b\u044c\u044e\". \u041f\u043e\u0441\u043b\u0435 \u0447\u0435\u0433\u043e \u0441\u043e\u0445\u0440\u0430\u043d\u0438\u0442\u0435 \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f.<br \/>\n                    \u0426\u0435\u043b\u044c \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0430, \u043c\u043e\u0436\u043d\u043e \u0438\u0437\u043c\u0435\u0440\u044f\u0442\u044c \u043a\u043e\u043d\u0432\u0435\u0440\u0441\u0438\u044e \u0441\u043a\u0440\u0438\u043f\u0442\u0430 \u0438 \u043e\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u043e\u0432!", "messages", "ru");
    t.add("help_statistic_conversion_3", "\u0414\u0430\u043b\u0435\u0435, \u0434\u043b\u044f \u0441\u0431\u043e\u0440\u0430 \u0441\u0442\u0430\u0442\u0438\u0441\u0442\u0438\u043a\u0438 \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e, \u0447\u0442\u043e\u0431\u044b \u043e\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u044b \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0440\u0430\u0437 \u043f\u0440\u043e\u0432\u0435\u043b\u0438 \u0431\u0435\u0441\u0435\u0434\u044b, \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044f\n                    \u0441\u043a\u0440\u0438\u043f\u0442.<br \/>\u041f\u043e\u0441\u043b\u0435 \u044d\u0442\u043e\u0433\u043e, \u043f\u0435\u0440\u0435\u0439\u0434\u044f \u0432 \u0440\u0430\u0437\u0434\u0435\u043b \"\u041a\u043e\u043d\u0432\u0435\u0440\u0441\u0438\u044f\" \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0443\u044e\u0449\u0435\u0433\u043e \u0441\u043a\u0440\u0438\u043f\u0442\u0430, \u043c\u043e\u0436\u043d\u043e\n                    \u043f\u0440\u043e\u0441\u043c\u043e\u0442\u0440\u0435\u0442\u044c \u0441\u0442\u0430\u0442\u0438\u0441\u0442\u0438\u043a\u0443:", "messages", "ru");
    t.add("help_statistic_conversion_capability_1", "\u041a\u043e\u043d\u0432\u0435\u0440\u0441\u0438\u044f \u0442\u0435\u043a\u0443\u0449\u0435\u0439 \u0432\u0435\u0440\u0441\u0438\u0438 \u0441\u043a\u0440\u0438\u043f\u0442\u0430 \u0432 \u0446\u0435\u043b\u043e\u043c", "messages", "ru");
    t.add("help_statistic_conversion_capability_2", "\u041a\u043e\u043d\u0432\u0435\u0440\u0441\u0438\u044f \u043a\u0430\u0436\u0434\u043e\u0433\u043e \u043e\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 \u043f\u043e \u0442\u0435\u043a\u0443\u0449\u0435\u0439 \u0432\u0435\u0440\u0441\u0438\u0438 \u0441\u043a\u0440\u0438\u043f\u0442\u0430", "messages", "ru");
    t.add("help_statistic_conversion_capability_3", "\u041a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0437\u0432\u043e\u043d\u043a\u043e\u0432 \u0432\u0441\u0435\u0433\u043e", "messages", "ru");
    t.add("help_statistic_conversion_capability_4", "\u041a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0443\u0441\u043f\u0435\u0448\u043d\u044b\u0445\/\u043e\u0442\u043a\u043b\u043e\u043d\u0435\u043d\u043d\u044b\u0445", "messages", "ru");
    t.add("help_statistic_conversion_capability_5", "\u041a\u0430\u043a\u0438\u0435 \u0443\u0437\u043b\u044b \u044f\u0432\u043b\u044f\u044e\u0442\u0441\u044f \u043d\u0430\u0438\u0431\u043e\u043b\u0435\u0435 \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0430\u0442\u0438\u0447\u043d\u044b\u043c\u0438", "messages", "ru");
    t.add("help_statistic_conversion_capability_6", "\u041d\u0430 \u043a\u0430\u043a\u0438\u0445 \u0443\u0437\u043b\u0430\u0445 \u043d\u0435\u0442 \u043d\u0443\u0436\u043d\u043e\u0433\u043e \u043e\u0442\u0432\u0435\u0442\u0430", "messages", "ru");
    t.add("help_integration_heading", "\u0418\u043d\u0442\u0435\u0433\u0440\u0430\u0446\u0438\u0438", "messages", "ru");
    t.add("help_integration_amo_instructions_1", "\u041d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e \u0432\u043e\u0439\u0442\u0438 \u0432 amoCRM \u043f\u043e\u0434 \u0443\u0447\u0435\u0442\u043d\u043e\u0439 \u0437\u0430\u043f\u0438\u0441\u044c\u044e \u0441 \u043f\u0440\u0430\u0432\u0430\u043c\u0438 \u0430\u0434\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430\u0442\u043e\u0440\u0430, \u043f\u0435\u0440\u0435\u0439\u0442\u0438 \u0432 \u0440\u0430\u0437\u0434\u0435\u043b\n                    &laquo;\u041d\u0430\u0441\u0442\u0440\u043e\u0439\u043a\u0438&raquo; \u2013 &laquo;\u0418\u043d\u0442\u0435\u0433\u0440\u0430\u0446\u0438\u0438&raquo;.\n                    \u0412\u044b\u0431\u0440\u0430\u0442\u044c \u0438\u0437 \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0430 \u0438 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u044c \u043f\u043b\u0430\u0433\u0438\u043d &laquo;HyperScript&raquo;.", "messages", "ru");
    t.add("help_integration_amo_instructions_2", "\u0417\u0430\u0442\u0435\u043c \u0432\u0441\u0435 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u044b, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0431\u0443\u0434\u0443\u0442 \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u0441\u043a\u0440\u0438\u043f\u0442\u0430\u043c\u0438, \u0434\u043e\u043b\u0436\u043d\u044b \u0441\u0434\u0435\u043b\u0430\u0442\u044c \u0430\u043a\u043a\u0430\u0443\u043d\u0442 \u043d\u0430\n                    http:\/\/hyper-script.ru, \u043f\u0440\u043e\u0439\u0434\u044f \u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u044e.", "messages", "ru");
    t.add("help_integration_amo_instructions_3", "\u041f\u043e\u0441\u043b\u0435 \u044d\u0442\u043e\u0433\u043e \u043a\u0430\u0436\u0434\u044b\u0439 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0434\u043e\u043b\u0436\u0435\u043d \u0432\u043e\u0439\u0442\u0438 \u0432 amoCRM, \u043f\u0435\u0440\u0435\u0439\u0442\u0438, \u043d\u0430\u043f\u0440\u0438\u043c\u0435\u0440, \u0432 \u043f\u0440\u043e\u0441\u043c\u043e\u0442\u0440 \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u043e\u0433\u043e\n                    \u043a\u043e\u043d\u0442\u0430\u043a\u0442\u0430. \u0412 \u043f\u0440\u0430\u0432\u043e\u0439 \u043f\u0430\u043d\u0435\u043b\u0438 \u0431\u0443\u0434\u0435\u0442 \u0432\u0438\u0434\u0435\u043d \u0432\u0438\u0434\u0436\u0435\u0442 &laquo;HyperScript&raquo;.\n                    \u0415\u0441\u043b\u0438 \u0435\u0433\u043e \u043e\u0442\u043a\u0440\u044b\u0442\u044c, \u043f\u043e\u044f\u0432\u0438\u0442\u0441\u044f \u0444\u043e\u0440\u043c\u0430 \u0430\u0432\u0442\u043e\u0440\u0438\u0437\u0430\u0446\u0438\u0438. \u0412 \u044d\u0442\u0443 \u0444\u043e\u0440\u043c\u0443 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0432\u0432\u043e\u0434\u0438\u0442 \u0421\u0412\u041e\u0418 \u043b\u043e\u0433\u0438\u043d-\u043f\u0430\u0440\u043e\u043b\u044c \u043e\u0442\n                    \u0430\u043a\u043a\u0430\u0443\u043d\u0442\u0430 &laquo;HyperScript&raquo;, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u0440\u0430\u043d\u0435\u0435 \u0432 \u0445\u043e\u0434\u0435\n                    \u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u0438 \u043d\u0430 http:\/\/hyper-script.ru.", "messages", "ru");
    t.add("help_integration_amo_instructions_4", "\u0410\u043a\u043a\u0430\u0443\u043d\u0442 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430 \u043f\u0440\u0438\u0432\u044f\u0437\u0430\u043d. \u0412\u0430\u043c \u0442\u0430\u043a\u0436\u0435 \u043f\u043e\u0442\u0440\u0435\u0431\u0443\u0435\u0442\u0441\u044f \u0432\u044b\u0434\u0430\u0442\u044c \u0434\u043e\u0441\u0442\u0443\u043f \u043a \u0441\u043a\u0440\u0438\u043f\u0442\u0430\u043c, \u0447\u0442\u043e\u0431\u044b \u043e\u043d\u0438 \u0441\u0442\u0430\u043b\u0438\n                    \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u044b \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430\u043c. \u042d\u0442\u043e \u0434\u0435\u043b\u0430\u0435\u0442\u0441\u044f \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u043c. \u0412\u044b \u0441\u043e\u0437\u0434\u0430\u0435\u0442\u0435 \u0441\u043a\u0440\u0438\u043f\u0442 \u0432 HyperScript, \u043f\u0435\u0440\u0435\u0445\u043e\u0434\u0438\u0442\u0435\n                    \u043d\u0430 \u0432\u043a\u043b\u0430\u0434\u043a\u0443 &laquo;\u0414\u043e\u0441\u0442\u0443\u043f&raquo;, \u0432\u043f\u0438\u0441\u044b\u0432\u0430\u0435\u0442\u0435 \u0432 \u0444\u043e\u0440\u043c\u0443 e-mail \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430, \u043f\u043e\u0434\n                    \u043a\u043e\u0442\u043e\u0440\u044b\u043c \u043e\u043d \u0437\u0430\u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u043d \u0432 HyperScript (\u0412\u043d\u0438\u043c\u0430\u043d\u0438\u0435! \u042d\u0442\u043e\u0442 e-mail \u043c\u043e\u0436\u0435\u0442 \u043d\u0435 \u0441\u043e\u0432\u043f\u0430\u0434\u0430\u0442\u044c \u0441 e-mail, \u043f\u043e\u0434\n                    \u043a\u043e\u0442\u043e\u0440\u044b\u043c \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0437\u0430\u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u043d \u0432 amoCRM), \u044d\u0442\u043e\u0442 e-mail \u0432\u0441\u0435\u0433\u0434\u0430 \u0432\u0438\u0434\u0435\u043d \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0443 \u0432 \u0432\u0435\u0440\u0445\u043d\u0435\u0439 \u0447\u0430\u0441\u0442\u0438 \u0435\u0433\u043e\n                    \u043b\u0438\u0447\u043d\u043e\u0433\u043e \u043a\u0430\u0431\u0438\u043d\u0435\u0442\u0430 HyperScript.", "messages", "ru");
    t.add("help_integration_bitrix_instructions", "\u0412\u0438\u0434\u0436\u0435\u0442 \u0438\u043d\u0442\u0435\u0433\u0440\u0430\u0446\u0438\u0438 \u0434\u043e\u0441\u0442\u0443\u043f\u0435\u043d \u0432 \u041c\u0430\u0440\u043a\u0435\u0442\u043f\u043b\u0435\u0439\u0441 \u0411\u0438\u0442\u0440\u0438\u043a\u044124 <a target=\"_blank\"\n                href=\"https:\/\/www.bitrix24.ru\/apps\/?app=hyperscript.core\">\n                https:\/\/www.bitrix24.ru\/apps\/?app=hyperscript.core<\/a>.", "messages", "ru");
    t.add("help_integration_bitrix_instructions_1", "\u041d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e \u0432\u043e\u0439\u0442\u0438 \u0432 \u0411\u0438\u0442\u0440\u0438\u043a\u044124 \u043f\u043e\u0434 \u0443\u0447\u0435\u0442\u043d\u043e\u0439 \u0437\u0430\u043f\u0438\u0441\u044c\u044e \u0441 \u043f\u0440\u0430\u0432\u0430\u043c\u0438 \u0430\u0434\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430\u0442\u043e\u0440\u0430, \u043f\u0435\u0440\u0435\u0439\u0442\u0438 \u0432 \u0440\u0430\u0437\u0434\u0435\u043b\n                    &laquo;\u041f\u0440\u0438\u043b\u043e\u0436\u0435\u043d\u0438\u044f&raquo; \u2013 &laquo;\u0412\u0441\u0435 \u043f\u0440\u0438\u043b\u043e\u0436\u0435\u043d\u0438\u044f\n                    &raquo; \u0432 \u043e\u0441\u043d\u043e\u0432\u043d\u043e\u043c \u043c\u0435\u043d\u044e.", "messages", "ru");
    t.add("help_integration_bitrix_instructions_2", "\u0417\u0430\u0442\u0435\u043c \u0432\u0441\u0435 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u044b, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0431\u0443\u0434\u0443\u0442 \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u0441\u043a\u0440\u0438\u043f\u0442\u0430\u043c\u0438, \u0434\u043e\u043b\u0436\u043d\u044b \u0441\u0434\u0435\u043b\u0430\u0442\u044c \u0430\u043a\u043a\u0430\u0443\u043d\u0442 \u043d\u0430\n                    http:\/\/hyper-script.ru, \u043f\u0440\u043e\u0439\u0434\u044f \u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u044e.", "messages", "ru");
    t.add("help_integration_bitrix_instructions_3", "\u041f\u043e\u0441\u043b\u0435 \u044d\u0442\u043e\u0433\u043e \u043a\u0430\u0436\u0434\u044b\u0439 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0434\u043e\u043b\u0436\u0435\u043d \u0432\u043e\u0439\u0442\u0438 \u0432 \u0411\u0438\u0442\u0440\u0438\u043a\u044124, \u043f\u0435\u0440\u0435\u0439\u0442\u0438 \u043d\u0430 \u0432\u043a\u043b\u0430\u0434\u043a\u0443\n                    &laquo;\u0421\u043a\u0440\u0438\u043f\u0442\u044b&raquo; \u0432 \u043e\u0441\u043d\u043e\u0432\u043d\u043e\u043c \u043c\u0435\u043d\u044e, \u0441\u043b\u0435\u0432\u0430. \u0412 \u043e\u0441\u043d\u043e\u0432\u043d\u043e\u0439 \u043e\u0431\u043b\u0430\u0441\u0442\u0438 \u0431\u0443\u0434\u0435\u0442\n                    \u0432\u0438\u0434\u043d\u0430 \u0444\u043e\u0440\u043c\u0430 \u0430\u0432\u0442\u043e\u0440\u0438\u0437\u0430\u0446\u0438\u0438. \u0412 \u044d\u0442\u0443 \u0444\u043e\u0440\u043c\u0443 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0432\u0432\u043e\u0434\u0438\u0442 \u0421\u0412\u041e\u0418 \u043b\u043e\u0433\u0438\u043d-\u043f\u0430\u0440\u043e\u043b\u044c \u043e\u0442 \u0430\u043a\u043a\u0430\u0443\u043d\u0442\u0430\n                    &laquo;HyperScript&raquo;, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u0440\u0430\u043d\u0435\u0435 \u0432 \u0445\u043e\u0434\u0435 \u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u0438 \u043d\u0430\n                    http:\/\/hyper-script.ru.", "messages", "ru");
    t.add("help_integration_bitrix_instructions_4", "\u0410\u043a\u043a\u0430\u0443\u043d\u0442 \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430 \u043f\u0440\u0438\u0432\u044f\u0437\u0430\u043d. \u0412\u0430\u043c \u0442\u0430\u043a\u0436\u0435 \u043f\u043e\u0442\u0440\u0435\u0431\u0443\u0435\u0442\u0441\u044f \u0432\u044b\u0434\u0430\u0442\u044c \u0434\u043e\u0441\u0442\u0443\u043f \u043a \u0441\u043a\u0440\u0438\u043f\u0442\u0430\u043c, \u0447\u0442\u043e\u0431\u044b \u043e\u043d\u0438 \u0441\u0442\u0430\u043b\u0438\n                    \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u044b \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430\u043c. \u042d\u0442\u043e \u0434\u0435\u043b\u0430\u0435\u0442\u0441\u044f \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u043c. \u0412\u044b \u0441\u043e\u0437\u0434\u0430\u0435\u0442\u0435 \u0441\u043a\u0440\u0438\u043f\u0442 \u0432 HyperScript, \u043f\u0435\u0440\u0435\u0445\u043e\u0434\u0438\u0442\u0435\n                    \u043d\u0430 \u0432\u043a\u043b\u0430\u0434\u043a\u0443 &laquo;\u0414\u043e\u0441\u0442\u0443\u043f&raquo;, \u0432\u043f\u0438\u0441\u044b\u0432\u0430\u0435\u0442\u0435 \u0432 \u0444\u043e\u0440\u043c\u0443 e-mail \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0430, \u043f\u043e\u0434\n                    \u043a\u043e\u0442\u043e\u0440\u044b\u043c \u043e\u043d \u0437\u0430\u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u043d \u0432 HyperScript (\u0412\u043d\u0438\u043c\u0430\u043d\u0438\u0435! \u042d\u0442\u043e\u0442 e-mail \u043c\u043e\u0436\u0435\u0442 \u043d\u0435 \u0441\u043e\u0432\u043f\u0430\u0434\u0430\u0442\u044c \u0441 e-mail,\n                    \u043f\u043e\u0434 \u043a\u043e\u0442\u043e\u0440\u044b\u043c \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440 \u0437\u0430\u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u043d \u0432 \u0411\u0438\u0442\u0440\u0438\u043a\u044124), \u044d\u0442\u043e\u0442 e-mail \u0432\u0441\u0435\u0433\u0434\u0430 \u0432\u0438\u0434\u0435\u043d \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u0443 \u0432 \u0432\u0435\u0440\u0445\u043d\u0435\u0439 \u0447\u0430\u0441\u0442\u0438\n                    \u0435\u0433\u043e \u043b\u0438\u0447\u043d\u043e\u0433\u043e \u043a\u0430\u0431\u0438\u043d\u0435\u0442\u0430 HyperScript.", "messages", "ru");
    t.add("help_integration_other_heading", "\u041a\u0430\u043a \u0438\u043d\u0442\u0435\u0433\u0440\u0438\u0440\u043e\u0432\u0430\u0442\u044c \u0430\u043a\u043a\u0430\u0443\u043d\u0442 \u0441 \u0434\u0440\u0443\u0433\u0438\u043c\u0438 \u043f\u0440\u043e\u043c\u044b\u0448\u043b\u0435\u043d\u043d\u044b\u043c\u0438 CRM?", "messages", "ru");
    t.add("help_integration_other", "\u0412 \u0434\u0430\u043d\u043d\u044b\u0439 \u043c\u043e\u043c\u0435\u043d\u0442 \u0438\u043d\u0442\u0435\u0433\u0440\u0430\u0446\u0438\u044f \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u0430 \u043f\u043e \u0438\u043d\u0434\u0438\u0432\u0438\u0434\u0443\u0430\u043b\u044c\u043d\u043e\u043c\u0443 \u0437\u0430\u043f\u0440\u043e\u0441\u0443 \u0432 \u0441\u043b\u0443\u0436\u0431\u0443 \u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u043a\u0438\n                    \u0447\u0435\u0440\u0435\u0437 API HyperScript.", "messages", "ru");
    t.add("help_integration_your_heading", "\u041a\u0430\u043a \u0438\u043d\u0442\u0435\u0433\u0440\u0438\u0440\u043e\u0432\u0430\u0442\u044c \u0430\u043a\u043a\u0430\u0443\u043d\u0442 \u0441 CRM, \u0440\u0430\u0437\u0440\u0430\u0431\u0430\u0442\u044b\u0432\u0430\u0435\u043c\u043e\u0439 \u0432\u0430\u0448\u0438\u043c\u0438 \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0430\u043c\u0438 \u0432\u043d\u0443\u0442\u0440\u0438 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438?", "messages", "ru");
    t.add("help_integration_your_1", "\u0412\u044b \u0434\u0435\u043b\u0430\u0435\u0442\u0435 \u0437\u0430\u043f\u0440\u043e\u0441 \u0432 \u0441\u043b\u0443\u0436\u0431\u0443 \u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u043a\u0438 \u043d\u0430 \u0438\u043d\u0442\u0435\u0433\u0440\u0430\u0446\u0438\u044e", "messages", "ru");
    t.add("help_integration_your_2", "\u0412\u0430\u0448\u0438 \u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u0441\u043f\u0430\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u044b \u043e\u0431\u0449\u0430\u044e\u0442\u0441\u044f \u0441 \u043d\u0430\u0448\u0438\u043c\u0438, \u0438\u0437\u0443\u0447\u0430\u044e\u0442 \u043c\u0435\u0442\u043e\u0434\u044b API", "messages", "ru");
    t.add("help_integration_your_3", "\u0412\u0430\u0448\u0438 \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u044b \u0432\u0441\u0442\u0440\u0430\u0438\u0432\u0430\u044e\u0442 \u0432 \u0438\u043d\u0442\u0435\u0440\u0444\u0435\u0439\u0441 CRM \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u044b HyperScript \u0441 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435\u043c API", "messages", "ru");
    t.add("help_integration_your_4", "\u0421\u043f\u0435\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u044b HyperScript \u043f\u0440\u043e\u0432\u043e\u0434\u044f\u0442 \u043a\u043e\u043d\u0441\u0443\u043b\u044c\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0435 \u0432 \u0445\u043e\u0434\u0435 \u0438\u043d\u0442\u0435\u0433\u0440\u0430\u0446\u0438\u0438.", "messages", "ru");
    t.add("faq", "\u0427\u0430\u0441\u0442\u043e \u0437\u0430\u0434\u0430\u0432\u0430\u0435\u043c\u044b\u0435 \u0432\u043e\u043f\u0440\u043e\u0441\u044b", "messages", "ru");
    t.add("faq_1", "\u041a\u0430\u043a \u0441\u043e\u0437\u0434\u0430\u0442\u044c \u0432\u0435\u0442\u0432\u043b\u0435\u043d\u0438\u0435 \u0432 \u043b\u043e\u0433\u0438\u043a\u0435, \u043a\u043e\u0433\u0434\u0430 \u0432 \u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438 \u043e\u0442 \u0442\u043e\u0433\u043e, \u0447\u0442\u043e \u043e\u043f\u0435\u0440\u0430\u0442\u043e\u0440 \u0443\u0432\u0438\u0434\u0435\u043b \u0432 \u0441\u043a\u043b\u0430\u0434\u0441\u043a\u043e\u0439\n                    \u0441\u0438\u0441\u0442\u0435\u043c\u0435 \u043f\u043e\u0441\u043b\u0435 \u0437\u0430\u043f\u0440\u043e\u0441\u0430 \u043a\u043b\u0438\u0435\u043d\u0442\u0430, \u043d\u0443\u0436\u043d\u043e \u0441\u043a\u0430\u0437\u0430\u0442\u044c \u0442\u0443 \u0438\u043b\u0438 \u0438\u043d\u0443\u044e \u0444\u0440\u0430\u0437\u0443?", "messages", "ru");
    t.add("faq_2", "\u0412 \u0442\u0430\u043a\u043e\u043c \u0441\u043b\u0443\u0447\u0430\u0435 \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e \u0441\u043e\u0437\u0434\u0430\u0442\u044c \u043e\u0442\u0432\u0435\u0442\u0430 \u043e\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 \"\u041e\u0434\u043d\u0443 \u043c\u0438\u043d\u0443\u0442\u0443, \u044f \u0443\u0442\u043e\u0447\u043d\u044e \u043d\u0430\u043b\u0438\u0447\u0438\u0435 \u0432 \u0431\u0430\u0437\u0435.\n                    [\u0423\u0442\u043e\u0447\u043d\u044f\u0435\u043c \u0432 \u0431\u0430\u0437\u0435]\", \u043a \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 \u0434\u043e\u0431\u0430\u0432\u0438\u0442\u044c 2 \u0432\u0430\u0440\u0438\u0430\u043d\u0442\u0430 \u043e\u0442\u0432\u0435\u0442\u0430: \u0435\u0441\u0442\u044c \u0432 \u043d\u0430\u043b\u0438\u0447\u0438\u0438, \u043d\u0435\u0442 \u0432 \u043d\u0430\u043b\u0438\u0447\u0438\u0438 \u2013 \u0432\u0435\u0434\u0443\u0449\u0438\u0435\n                    \u043d\u0430 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0432\u0443\u044e\u0449\u0438\u0435 \u0443\u0437\u043b\u044b \u0440\u0435\u043f\u043b\u0438\u043a \u043e\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430.<br \/>\u0412 \u0434\u0430\u043d\u043d\u043e\u043c \u0441\u043b\u0443\u0447\u0430\u0435 \"\u0435\u0441\u0442\u044c \u0432 \u043d\u0430\u043b\u0438\u0447\u0438\u0438\" \u0438 \"\u043d\u0435\u0442 \u0432 \u043d\u0430\u043b\u0438\u0447\u0438\u0438\" \u043d\n                    \u0435 \u044f\u0432\u043b\u044f\u044e\u0442\u0441\u044f \u043e\u0442\u0432\u0435\u0442\u0430\u043c\u0438 \u043a\u043b\u0438\u0435\u043d\u0442\u0430, \u0430 \u0441\u043b\u0443\u0436\u0430\u0442 \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u043f\u0435\u0440\u0435\u043a\u043b\u044e\u0447\u0430\u0442\u0435\u043b\u0435\u0439 \u043b\u043e\u0433\u0438\u043a\u0438.", "messages", "ru");
